import { Typography } from '@material-ui/core'
import React, { Component } from 'react'

export default class MainBackDrop extends Component {
    render() {
        return (
            <div>
                <Typography 
                variant="h1"
                align="center"
                >
                    <div>CAREERS UNCORKED</div>
                </Typography>

                <div className="sub-header">ONE COMMUNITY, WHERE JOURNEYS CONVERGE</div>
                <div className="explanation">SIGN UP TO OUR MAILING LIST TO RECEIVE A REMINDER FOR OURUPCOMING EVENTS</div>
            </div>
        )
    }
}
